import React, { useState } from "react";
import "./style.css";

const buttons = [
  '%', 'CE', 'C', 'del',
  '1/x', 'x²', '√', '/',
  '7', '8', '9', '*',
  '4', '5', '6', '-',
  '1', '2', '3', '+',
  '+/-', '0', '.', '='
];
const symbols = ["+", "-", "*", "/"];

export default function Calculator() {
  const [display, setDisplay] = useState("");
  const [currentNumber, setCurrentNumber] = useState("");
  const [lastResult, setLastResult] = useState(null); // Store the last result
  const [lastOperator, setLastOperator] = useState(null); // Store the last operator

  const fetchResult = async (operation, params) => {
    try {
      const response = await fetch(`http://localhost:8080/calculator/${operation}`, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify(params),
      });
      if (!response.ok) {
        throw new Error("Network response was not ok");
      }

      const result = await response.text();
      return result;
    } catch (error) {
      console.error("Backend error:", error);
      return "Error";
    }
  };

  const handleOperation = async (operator) => {
    if (currentNumber === "") return;

    // If there is a last result, we should calculate it first
    if (lastResult !== null && lastOperator !== null) {
      const previousResult = await fetchResult(lastOperator, { a: lastResult, b: parseFloat(currentNumber) });
      setDisplay(previousResult);
      setLastResult(previousResult);
    } else {
      // If there's no previous calculation, just set the last result as current number
      setLastResult(parseFloat(currentNumber));
      setDisplay(currentNumber);
    }

    setCurrentNumber(""); // Reset current number
    setLastOperator(operator); // Update last operator
    setDisplay((prev) => prev + ` ${operator} `); // Display the operator
  };

  const handleEquals = async () => {
    if (currentNumber === "") return;

    if (lastResult !== null && lastOperator !== null) {
      const finalResult = await fetchResult(lastOperator, { a: lastResult, b: parseFloat(currentNumber) });
      setDisplay(finalResult);
      setLastResult(finalResult);
      setCurrentNumber(""); // Reset after equals
      setLastOperator(null); // Reset last operator
    }
  };

  const handleClick = (button) => {
    if (button === "C" || button === "CE") {
      setDisplay("");
      setCurrentNumber("");
      setLastResult(null);
      setLastOperator(null);
    } else if (button === "del") {
      setCurrentNumber(currentNumber.slice(0, -1));
      setDisplay(display.slice(0, -1));
    } else if (button === "+/-") {
      if (currentNumber) {
        const toggledNumber = (parseFloat(currentNumber) * -1).toString();
        setCurrentNumber(toggledNumber);
        setDisplay((prev) =>
          prev.slice(0, -currentNumber.length) + toggledNumber 
        );
      }
    } else if (symbols.includes(button)) {
      handleOperation(button);
    } else if (button === "=") {
      handleEquals();
    } else {
      setCurrentNumber(currentNumber + button);
      setDisplay(display + button);
    }
  };

  return (
    <div className="calculator">
      <div className="display">{display}</div>
      <div className="buttons">
        {buttons.map((button) => (
          <button key={button} onClick={() => handleClick(button)}>
            {button}
          </button>
        ))}
      </div>
    </div>
  );
}
